import logo from "./logo.svg";
import "./css/App.css";
import Sudoku from "./components/Sudoku.js";

function App() {
  return (
    <div className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <Sudoku></Sudoku>
    </div>
  );
}

export default App;
